ALTER TABLE `chi_newsletter_email`
	CHANGE COLUMN `create_time` `create_time` DATETIME NULL DEFAULT NULL AFTER `email`,
	ADD COLUMN `update_time` DATETIME NULL DEFAULT NULL AFTER `create_time`;

ALTER TABLE `identify`
	CHANGE COLUMN `final_earn` `handicap_result` INT(11) NULL DEFAULT NULL AFTER `over_under_odds`,
	ADD COLUMN `over_under_result` INT(11) NULL DEFAULT NULL AFTER `handicap_result`;
ALTER TABLE `user`
	ADD COLUMN `role_id` TINYINT NULL DEFAULT NULL AFTER `status`;

ALTER TABLE `identify`
	ADD COLUMN `handicap_earn` INT NULL DEFAULT NULL AFTER `over_under`,
	ADD COLUMN `over_under_earn` INT NULL DEFAULT NULL AFTER `handicap_earn`,
	ADD COLUMN `final_earn` INT NULL DEFAULT NULL AFTER `over_under_earn`;
UPDATE identify
SET handicap_earn = 100
WHERE handicap is not null;
UPDATE identify
SET over_under_earn = 100
WHERE over_under is not null;

