Còn về phần admin: E làm giúp a thêm mấy mục này nhé:
- Mỗi trận đấu e mặc định cho người nhận định đặt 1 mức cược là 10 điểm; tương ứng với tỉ lệ odds mà hệ thống mình đang thu thập được;
Sau khi có kết quả thì e tính xem kết quả thắng thua của từng ngày; Múi giờ ttuowng tự 188bet và Sbobet đang dùng (vào giờ mua hè thì bắt đầu và kết thúc vào 10h sáng, mua đông là 11h, e lấy thêm thông tin về khoản này cho chính xác giúp anh). 
Sau khi có kết quả thắng thua, e vẽ đồ thị tổng điểm thắng/thua từng ngày;
Ngoài ra mình sẽ thống kê kết quả theo giải đấu, loại hình cược, xem được theo thời gian (như  cái filter)
Nội dung phần thống kê này chỉ quản trị cao nhất mới xem được e nhé.

